     <p class=MsoNormal align=center style='text-align:center'><b><span
     style='font-size:16.0pt;mso-bidi-font-size:18.0pt'>科技创新是人的天赋，是人的乐趣<span
     lang=EN-US><o:p></o:p></span></span></b></p>
     <p class=MsoNormal align=center style='text-align:center'><b><span
     style='font-size:16.0pt;mso-bidi-font-size:18.0pt'>我们是<span lang=EN-US><o:p></o:p></span></span></b></p>
     <p class=MsoNormal align=center style='text-align:center'><b><span
     style='font-size:16.0pt;mso-bidi-font-size:18.0pt'>一家相变复合纤维开发企业<span
     lang=EN-US><o:p></o:p></span></span></b></p>
     <p class=MsoNormal align=center style='text-align:center'><b><span
     style='font-size:16.0pt;mso-bidi-font-size:18.0pt'>扎根在肥沃的土壤<span
     lang=EN-US><o:p></o:p></span></span></b></p>
     <p class=MsoNormal align=center style='text-align:center'><b><span
     style='font-size:16.0pt;mso-bidi-font-size:18.0pt'>等着春天的到来<span
     lang=EN-US><o:p></o:p></span></span></b></p>
     <p class=MsoNormal align=center style='text-align:center'><b><span
     lang=EN-US style='font-size:16.0pt;mso-bidi-font-size:18.0pt'><o:p>&nbsp;</o:p></span></b></p>
     <p class=MsoNormal align=center style='text-align:center'><b><span
     lang=EN-US>INNOVATION IS HUMAN NATURE AND ENJOYMENT<o:p></o:p></span></b></p>
     <p class=MsoNormal align=center style='text-align:center'><b><span
     lang=EN-US>WE ARE AN YOUNG INNOVATION COMPANY <o:p></o:p></span></b></p>
     <p class=MsoNormal align=center style='text-align:center'><b><span
     lang=EN-US>WHO MAKE A NEW PCM MATERIAL INTO FIBER AND GARMENTS<o:p></o:p></span></b></p>

   <![if !mso]>
   <table cellpadding=0 cellspacing=0 width="100%">
    <tr>
     <td><![endif]>
     <div>
     <p class=MsoNormal><b><span lang=EN-US style='color:black;mso-themecolor:
     text1'>1</span><span style='color:black;mso-themecolor:text1'>，<span
     lang=EN-US>2021.5<span style='mso-tab-count:1'>&nbsp;&nbsp;&nbsp;&nbsp; </span></span>调查相变纤维市场需求；查阅文献，联系关键客户。<span
     lang=EN-US><o:p></o:p></span></span></b></p>
     <p class=MsoNormal><b><span lang=EN-US style='color:black;mso-themecolor:
     text1'><o:p>&nbsp;</o:p></span></b></p>
     <p class=MsoNormal><b><span lang=EN-US style='color:black;mso-themecolor:
     text1'>2</span><span style='color:black;mso-themecolor:text1'>，<span
     lang=EN-US>2021.7<span style='mso-tab-count:1'>&nbsp;&nbsp;&nbsp;&nbsp; </span></span>初次进行复合相变长丝纤维纺丝，未获成功。需要调整设备。<span
     lang=EN-US><o:p></o:p></span></span></b></p>
     <p class=MsoNormal><b><span lang=EN-US style='color:black;mso-themecolor:
     text1'><o:p>&nbsp;</o:p></span></b></p>
     <p class=MsoNormal><b><span lang=EN-US style='color:black;mso-themecolor:
     text1'>3</span><span style='color:black;mso-themecolor:text1'>，<span
     lang=EN-US>2021.8<span style='mso-tab-count:1'>&nbsp;&nbsp;&nbsp;&nbsp; </span></span>初次进行相变复合短纤纺丝，成功获得<span
     lang=EN-US>4D51mm</span>二维短纤。<span lang=EN-US><o:p></o:p></span></span></b></p>
     <p class=MsoNormal><b><span lang=EN-US style='color:black;mso-themecolor:
     text1'><o:p>&nbsp;</o:p></span></b></p>
     <p class=MsoNormal><b><span lang=EN-US style='color:black;mso-themecolor:
     text1'>4</span><span style='color:black;mso-themecolor:text1'>，<span
     lang=EN-US>2021.11<span style='mso-tab-count:1'>&nbsp;&nbsp; </span></span>成功纺出相变复合长丝<span
     lang=EN-US>FDY100D/48F</span>。<span lang=EN-US><o:p></o:p></span></span></b></p>
     <p class=MsoNormal><b><span lang=EN-US style='color:black;mso-themecolor:
     text1'><o:p>&nbsp;</o:p></span></b></p>
     <p class=MsoNormal><b><span lang=EN-US style='color:black;mso-themecolor:
     text1'>5</span><span style='color:black;mso-themecolor:text1'>，<span
     lang=EN-US>2022.12<span style='mso-tab-count:1'>&nbsp;&nbsp; </span></span>成功纺出<span
     lang=EN-US>FDY100D/72F </span>半消光长丝<span lang=EN-US>60</span>公斤，并在第一批关键合作纺织厂进行了织布检验和染整检验。注册深圳市超焓新材科技有限公司作为孵化企业。<span
     lang=EN-US><o:p></o:p></span></span></b></p>
     <p class=MsoNormal><b><span lang=EN-US style='color:black;mso-themecolor:
     text1'><o:p>&nbsp;</o:p></span></b></p>
     <p class=MsoNormal><b><span lang=EN-US style='color:black;mso-themecolor:
     text1'>6</span><span style='color:black;mso-themecolor:text1'>，<span
     lang=EN-US>2022.03 </span>成功纺出<span lang=EN-US>FDY75/48</span>，并进行了面料织造检验。提出焓值概念面料和成衣的创意，为品牌提高有体验感的产品。同期进行了纤维商标注册<span
     lang=EN-US>JOULELON</span>（<span lang=EN-US>R</span>）受理。概念面料焓值可达到<span
     lang=EN-US>8-16</span>焦耳每克。<span lang=EN-US><o:p></o:p></span></span></b></p>
     <p class=MsoNormal><b><span lang=EN-US style='color:black;mso-themecolor:
     text1'><o:p>&nbsp;</o:p></span></b></p>
     <p class=MsoNormal><b><span lang=EN-US style='color:black;mso-themecolor:
     text1'>7</span><span style='color:black;mso-themecolor:text1'>，<span
     lang=EN-US><span style='mso-tab-count:1'>&nbsp; </span>2022.03 </span>成功试纺<span
     lang=EN-US>1.8D38mm</span>短纤。与最佳合作伙伴签订合作经销协议。<span lang=EN-US><o:p></o:p></span></span></b></p>
     <p class=MsoNormal><b><span lang=EN-US style='color:black;mso-themecolor:
     text1'><o:p>&nbsp;</o:p></span></b></p>
     <p class=MsoNormal><b><span lang=EN-US style='color:black;mso-themecolor:
     text1'>8</span><span style='color:black;mso-themecolor:text1'>， <span
     lang=EN-US>2022.05<span style='mso-tab-count:1'> </span></span>完成商业价值评估和商业计划。产品样品获得国内标杆纺织厂的认可。完成涤纶相变长丝<span
     lang=EN-US>FDY75/36</span>和<span lang=EN-US>DTY75/36</span>的生产、进入面料应用。<span
     lang=EN-US><o:p></o:p></span></span></b></p>
     <p class=MsoNormal><b><span lang=EN-US style='color:black;mso-themecolor:
     text1'><o:p>&nbsp;</o:p></span></b></p>
     <p class=MsoNormal><b><span lang=EN-US style='color:black;mso-themecolor:
     text1'>9</span><span style='color:black;mso-themecolor:text1'>，<span
     lang=EN-US>2023.02<span style='mso-tab-count:1'>&nbsp;&nbsp; </span></span>将试纺尼龙相变复合材料<span
     lang=EN-US>50/24FDY-SD</span>。完成面料的应用和评价<span lang=EN-US><o:p></o:p></span></span></b></p>
     <p class=MsoNormal><b><span lang=EN-US style='color:black;mso-themecolor:
     text1'><o:p>&nbsp;</o:p></span></b></p>
     <p class=MsoNormal><b><span lang=EN-US style='color:black;mso-themecolor:
     text1'>10</span><span style='color:black;mso-themecolor:text1'>，发表<span
     lang=EN-US>”JOULELON&reg;</span>超焓纤维<span lang=EN-US>-</span>一种新的涤纶相变纤维介绍与应用“ <span
     lang=EN-US><o:p></o:p></span></span></b></p>
     </div>
     <![if !mso]></td>
    </tr>
   </table>
   <![endif]></v:textbox>

     <div>
     <p class=MsoNormal style='text-align:justify;text-justify:distribute-all-lines'><span
     lang=EN-US style='font-size:11.0pt;mso-bidi-font-size:12.0pt'><span
     style='mso-tab-count:1'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>WE USE
     AN ADVANCED SOLID PCM TO MAKE TEXTILE PRODUCTS. <span
     style='mso-spacerun:yes'>&nbsp;</span>IT IS A BRANDED NEW PRODUCT WHICH
     HAS NOT SECOND ONE IN THE WORLD. THERE ARE SEVERAL PCM IN THE MARKET BUT
     THERE ARE SOLID TO LIQUE PHASE CHANGE MATERIALS WHICH IS NOT DURABLE. THE
     PCM WE USED IS SOLID TO SOLID POLYMER CRYSTELLINE PHASE CHANGE MATERIAL
     WITH ENTHALPY AT 80J/g, THE FIBER ENTHALPY COULD REACH 15J/G,GARMENT AND FABRICS
     ENTHALPY COULD REACH 5J/G OR HIGHER, WHILE THE TEMPERATURE OF PHASE
     CHANGING ARUND <span style='mso-spacerun:yes'>&nbsp;</span>25 <sup>O</sup>C
     AND 30 <sup>O</sup>C<o:p></o:p></span></p>
     <p class=MsoNormal style='text-align:justify;text-justify:distribute-all-lines'><span
     lang=EN-US style='font-size:11.0pt;mso-bidi-font-size:12.0pt'><span
     style='mso-tab-count:1'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span
     style='font-size:11.0pt;mso-bidi-font-size:12.0pt'>本公司采用固态的<span
     lang=EN-US>PCM</span>相变材料开发纤维纺织品产品，该产品是固态相变，比市场上的固体<span lang=EN-US>-</span>液体相变耐用，体验感强烈，相变温度<span
     lang=EN-US>25</span>度和<span lang=EN-US>30</span>度，焓值达到<span lang=EN-US>80</span>焦耳每克，服装或面料的焓值可以达到<span
     lang=EN-US>5</span>焦耳每克，或更高。<span lang=EN-US>PCM</span>相变材料可以改良涤纶纤维、尼龙纤维的服用舒适度，给消费者带来防止过冷、防止过热的舒适感。</span><span
     lang=EN-US style='font-size:12.0pt;mso-bidi-font-size:14.0pt;mso-fareast-font-family:
     等线;mso-fareast-theme-font:minor-latin'><o:p></o:p></span></p>
